import React from "react";
import GlideSlider from "../component/global/glide-slider";

// Define your new component
const FeaturedCollection = () => {
  // Prepare slide content
  const slides = [
    <img src="https://images.pexels.com/photos/1308881/pexels-photo-1308881.jpeg?auto=compress&cs=tinysrgb&w=400" alt="Slide 1" />,
    <img src="https://images.pexels.com/photos/1308881/pexels-photo-1308881.jpeg?auto=compress&cs=tinysrgb&w=400" alt="Slide 2" />,
    <img src="https://images.pexels.com/photos/1308881/pexels-photo-1308881.jpeg?auto=compress&cs=tinysrgb&w=400" alt="Slide 3" />,

    <img src="https://images.pexels.com/photos/1308881/pexels-photo-1308881.jpeg?auto=compress&cs=tinysrgb&w=400" alt="Slide 1" />,
    <img src="https://images.pexels.com/photos/1308881/pexels-photo-1308881.jpeg?auto=compress&cs=tinysrgb&w=400" alt="Slide 2" />,
    <img src="https://images.pexels.com/photos/206648/pexels-photo-206648.jpeg?auto=compress&cs=tinysrgb&w=400" alt="Slide 3" />,
    <img src="https://images.pexels.com/photos/206648/pexels-photo-206648.jpeg?auto=compress&cs=tinysrgb&w=400" alt="Slide 3" />,

    <img src="https://images.pexels.com/photos/206648/pexels-photo-206648.jpeg?auto=compress&cs=tinysrgb&w=400" alt="Slide 3" />,

    <img src="https://images.pexels.com/photos/206648/pexels-photo-206648.jpeg?auto=compress&cs=tinysrgb&w=400" alt="Slide 3" />,

    <img src="https://images.pexels.com/photos/206648/pexels-photo-206648.jpeg?auto=compress&cs=tinysrgb&w=400" alt="Slide 3" />,

    // Add more slides as needed
    // Add more slides as needed
  ];

  // Render the component
  return (
    <div>
      <h1>My Component</h1>
      <GlideSlider slides={slides} />
    </div>
  );
};

export default FeaturedCollection ;
